import React, { Component } from 'react';

class Newslist extends Component{
    componentWillMount() {
        fetch("http://localhost:3000/newslist").then(response => {
            return response.json()
          }).then( data => {
              if(data.states == 200){
                console.log("444")
              }else{
                console.log(data)
              }
          })
    }
    constructor() {
        super(); // 调用基类的所有初始化方法
        this.state = {
          list: [
              {src:"//5b0988e595225.cdn.sohucs.com/c_fill,w_150,h_100,g_faces,q_70/images/20190415/0503a216a3374979b6a1190fa1b61c39.jpeg",
              title:"行政区划调整后济南市已成为山东首个特大城市，提前实现目",
              author:"澎湃新闻"},
              {src:"//5b0988e595225.cdn.sohucs.com/c_fill,w_150,h_100,g_faces,q_70/images/20190415/0503a216a3374979b6a1190fa1b61c39.jpeg",
              title:"行政区划调整后济南市已成为山东首个特大城市，提前实现目",
              author:"澎湃新闻"},
              {src:"//5b0988e595225.cdn.sohucs.com/c_fill,w_150,h_100,g_faces,q_70/images/20190415/0503a216a3374979b6a1190fa1b61c39.jpeg",
              title:"行政区划调整后济南市已成为山东首个特大城市，提前实现目",
              author:"澎湃新闻"},
              {src:"//5b0988e595225.cdn.sohucs.com/c_fill,w_150,h_100,g_faces,q_70/images/20190415/0503a216a3374979b6a1190fa1b61c39.jpeg",
              title:"行政区划调整后济南市已成为山东首个特大城市，提前实现目",
              author:"澎湃新闻"},
              {src:"//5b0988e595225.cdn.sohucs.com/c_fill,w_150,h_100,g_faces,q_70/images/20190415/0503a216a3374979b6a1190fa1b61c39.jpeg",
              title:"行政区划调整后济南市已成为山东首个特大城市，提前实现目",
              author:"澎湃新闻"},
              {src:"//5b0988e595225.cdn.sohucs.com/c_fill,w_150,h_100,g_faces,q_70/images/20190415/0503a216a3374979b6a1190fa1b61c39.jpeg",
              title:"行政区划调整后济南市已成为山东首个特大城市，提前实现目",
              author:"澎湃新闻"}
            ]
        }
    }
    render() {
        let items = [];
        this.state.list.map((item, index) => {
            items.push( <li>
                <img src={item.src}/>
                <div className="news_title">
                  <h3>{item.title}</h3>
                  <p>{item.author}</p>
                </div>
            </li>);
        })
      return <ul>
        {items}
    </ul>
    }
}

export default Newslist;
